cv::Mat dls::LeftMultVec(const cv::Mat& v)
{
	cv::Mat mat, row1, row2, row3;

	cv::hconcat(v.clone().t(), cv::Mat::zeros(1, 6, v.depth()), row1);	// first row
	cv::hconcat(cv::Mat::zeros(1, 3, v.depth()), v.clone().t(), row2);	// second row
	cv::hconcat(row2, cv::Mat::zeros(1, 3, v.depth()), row2);			// second ror
	cv::hconcat(cv::Mat::zeros(1, 6, v.depth()), v.clone().t(), row3);	// third row

	mat.push_back(row1);
	mat.push_back(row2);
	mat.push_back(row3);

	return mat;
}

